import { Formulario } from './component/Formulario'
import { Home } from './component/Home'
import { useState } from 'react';
import './App.css';


function App() {

  const [user, setUser] = useState([])

  return (
    <div className="App">
      {
       !user.length > 0
         ? <Formulario setUser={setUser} /> 
         : <Home user={user} setUser={setUser} />

      }

    </div>
  );
}

export default App;
